import React from "react";
import Data from "../../data/line_Chart_Data.json";
import {
  ResponsiveContainer,
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Legend,
  Tooltip,
  Label,
} from "recharts";
const LineChartDiagram = () => {
  return (
    <>
      <ResponsiveContainer width="100%" aspect={3}>
        <LineChart
          data={Data}
          width={500}
          height={1200}
          margin={{ top: 35, right: 7 }}
        >
          <CartesianGrid strokeDasharray="5 5" />
          <XAxis
            dataKey="name"
            interval={"preserveStartEnd"}
            tickFormatter={(value) => value + "Pro"}
          >
            {" "}
            <Label
              value="Pages of my website"
              offset={0}
              position="insideBottom"
            />
          </XAxis>
          <YAxis tickCount={9} />
          <Tooltip contentStyle={{ backgroundColor: "yellow" }} />
          <Legend verticalAlign="bottom" height={506} />
          <Line dataKey="student" stroke="red" activeDot={{ r: 8 }} />
          <Line
            type="monotone"
            dataKey="fees"
            stroke="green"
            activeDot={{ r: 8 }}
          />
        </LineChart>
      </ResponsiveContainer>
    </>
  );
};

export default LineChartDiagram;
